import './App.css';
import { IonPage, IonRedirect, IonRoute, IonRouterOutlet } from '@ionic/react';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import { IonReactRouter } from '@ionic/react-router';
import Login from './pages/Login';

function App() {
  return (
    <IonPage>
      <IonReactRouter>
        <IonRoute exact path="/login">
              <Login />
          </IonRoute>
          <IonRoute exact path="/">
              <IonRedirect to ='/posts'/>
          </IonRoute>
      </IonReactRouter>

      <Headers />
    </IonPage>
  );
}

export default App;
